        margin: 0;
        padding: 0;
        font-family: "Bai Jamjuree", sans-serif;
        height: 100%;
        overflow: hidden;
      }

      #annotation {
        position: absolute;
        top: 0;
        left: 0;
        z-index: 20;
        visibility: hidden;
        pointer-events: none;
      }
      #annotation-connection {
        position: absolute;
        top:0;
        left:0;
      }
      #annotation-body {
        position: absolute;
        top: 33px;
        left: 33px;
        z-index: 20;
        display: inline-table;
        height: auto;
        white-space: nowrap;
      }

      .few-articles {
        color: darkred;
      }

      .many-articles {
        color: green;
      }

      #article {
        visibility: hidden;
        position: absolute;
        z-index: 30;
        width: 40vw;
        height: 90vh;
        right: 5vw;
        top: 0;
        bottom: 0;
        margin: auto;  
      }

      #article-content {
        height: 100%;
        width: 100%;
      }

      .content {
        background-color: #ffffffdd;
        padding: 8px;
        border-radius: 4px;
        border: #70707070 1px solid;
        box-shadow: 10px;
        box-shadow: 3px 3px 5px #33333344;
      }

      #debug {
        z-index: 20;
        white-space: nowrap;
        position: absolute;
        top: 20px;
        left: 220px;
        font-size: x-small;
        display: none;
      }

      #chart-foreground-0 {
        position: absolute;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        pointer-events: none;
        z-index: 1;
      }

      #chart-foreground-1 {
        position: absolute;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        pointer-events: none;
        z-index: 1;
      }

      #chart {
        position: relative; /* for annotation */
        background-color: white;
        display: none;
        width: 100%;
        height: 100%;
      }
      /**
        * d3fc enforces some styles that we need to override here because they don't match our styles.
        */
      /* disabling d3fc axis and labels */
      #chart d3fc-svg.x-axis {
        height: 0;
      }
      #chart d3fc-svg.y-axis {
        width: 0;
      }

      #chart .chart-label,
      #chart .x-label,
      #chart .y-label {
        display: none;
      }
      /* below removes empty space around plots and keeps them overlaying */
      #chart d3fc-group.cartesian-chart {
        display: grid;
        grid-template-columns: 1fr;
        grid-template-rows: 1fr;
      }

        grid-row-start: 1;
        grid-column-start: 1;
